import Person from "./Person/Person"


const Persons = (props) => props.isPressed ? props.persons.map((person, index) => {
    console.log('[Persons.js] rendering...');
    return (<Person key={person.id} name={person.name}
        age={person.age} onClick={() => props.onClick(index)}
        onChange={(event) => props.onChange(event, person.id)} />)
}) : null;


export default Persons;
